INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "キャル", 7001, 1, 7, 106001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "コッコロ", 7002, 1, 7, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 7003, 1, 7, 105801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 10001, 1, 10, 105801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "キャル", 10002, 1, 10, 106001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "コッコロ", 10003, 1, 10, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "シェフィ", 10004, 1, 10, 106401, 0.0, 2104010, "2015/12/17 15:00:00", 1, 2, 0.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -416.5, "2030/12/17 14:59:59", "ペコリーヌ", 12001, 1, 12, 105801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "キャル", 13001, 1, 13, 106001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "コッコロ", 13002, 1, 13, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "シェフィ", 13003, 1, 13, 106401, 0.0, 2104010, "2015/12/17 15:00:00", 1, 2, 0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 13004, 1, 13, 105801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "コッコロ", 14001, 1, 14, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "シェフィ", 14002, 1, 14, 106401, 0.0, 2104010, "2015/12/17 15:00:00", 1, 2, 0.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 14003, 1, 14, 105801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "キャル", 14004, 1, 14, 106001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -470.0, "2030/12/17 14:59:59", "コッコロ", 15001, 1, 15, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "シェフィ", 16001, 1, 16, 106401, 0.0, 2104010, "2015/12/17 15:00:00", 1, 2, 0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 16002, 1, 16, 105801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "キャル", 16003, 1, 16, 106001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "コッコロ", 16004, 1, 16, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "コッコロ", 17002, 1, 17, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "キャル", 17004, 1, 25, 106001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "コッコロ", 17005, 1, 25, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "シェフィ", 17006, 1, 25, 106401, 0.0, 2104010, "2015/12/17 15:00:00", 1, 2, 0.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 17007, 1, 25, 105801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "カリン", 18001, 1, 18, 190801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "カリン", 18002, 1, 18, 190801, 0.0, 0, "2015/12/17 15:00:00", 2, 1, 0.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -470.0, "2030/12/17 14:59:59", "カリン", 19001, 1, 19, 190801, 0.0, 0, "2015/12/17 15:00:00", 3, 1, 0.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -470.0, "2030/12/17 14:59:59", "カリン", 19002, 1, 19, 190801, 0.0, 0, "2015/12/17 15:00:00", 4, 1, 0.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -470.0, "2030/12/17 14:59:59", "カリン", 20001, 1, 20, 190801, 0.0, 0, "2015/12/17 15:00:00", 5, 1, 0.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -470.0, "2030/12/17 14:59:59", "カリン", 20002, 1, 20, 190801, 0.0, 0, "2015/12/17 15:00:00", 6, 1, 0.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "キャル", 21001, 1, 21, 106001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "コッコロ", 21002, 1, 21, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "シェフィ", 21003, 1, 21, 106401, 0.0, 2104010, "2015/12/17 15:00:00", 1, 2, 0.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 21004, 1, 21, 105801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -430.0, "2030/12/17 14:59:59", "カリン", 22001, 1, 22, 190801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -430.0, "2030/12/17 14:59:59", "カリン", 22002, 1, 22, 190801, 0.0, 0, "2015/12/17 15:00:00", 2, 1, 0.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -430.0, "2030/12/17 14:59:59", "カリン", 23001, 1, 23, 190801, 0.0, 0, "2015/12/17 15:00:00", 3, 1, 0.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -430.0, "2030/12/17 14:59:59", "カリン", 23002, 1, 23, 190801, 0.0, 0, "2015/12/17 15:00:00", 4, 1, 0.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24001, 2, 24, 109001, 4.08, 0, "2019/01/31 12:00:00", 1, 1, 8.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24002, 2, 24, 109001, 5.0, 0, "2019/01/31 12:00:00", 2, 1, 8.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24003, 2, 24, 109001, 10.11, 0, "2019/01/31 12:00:00", 3, 1, 8.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24004, 2, 24, 109001, 4.0, 0, "2019/01/31 12:00:00", 4, 1, 8.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24005, 2, 24, 109001, 6.0, 0, "2019/01/31 12:00:00", 5, 1, 8.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24006, 1, 24, 109002, 0.0, 0, "2019/01/31 12:00:00", 6, 1, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24007, 1, 24, 109002, 0.0, 0, "2019/01/31 12:00:00", 7, 1, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24008, 1, 24, 109002, 0.0, 0, "2019/01/31 12:00:00", 8, 1, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24009, 1, 24, 109002, 0.0, 0, "2019/01/31 12:00:00", 9, 1, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24010, 1, 24, 109002, 0.0, 0, "2019/01/31 12:00:00", 10, 1, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, -385.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 24011, 2, 24, 109101, 2.12, 0, "2019/01/31 12:00:00", 1, 1, 8.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, -385.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 24012, 2, 24, 109101, 4.19, 0, "2019/01/31 12:00:00", 2, 5, 8.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, -385.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 24013, 4, 24, 109101, 2.3, 0, "2019/01/31 12:00:00", 3, 2, 8.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 24014, 1, 24, 109102, 0.0, 0, "2019/01/31 12:00:00", 4, 1, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, -385.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 24015, 2, 24, 109101, 5.23, 0, "2019/01/31 12:00:00", 5, 5, 8.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 24016, 1, 24, 109102, 0.0, 0, "2019/01/31 12:00:00", 6, 1, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, -385.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 24017, 2, 24, 109101, 5.01, 0, "2019/01/31 12:00:00", 7, 1, 8.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 24018, 1, 24, 109102, 0.0, 0, "2019/01/31 12:00:00", 8, 1, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 24019, 1, 24, 109102, 0.0, 0, "2019/01/31 12:00:00", 9, 1, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10011, 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 24020, 1, 24, 109102, 0.0, 0, "2019/01/31 12:00:00", 10, 1, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "シェフィ", 26001, 1, 26, 106401, 0.0, 2104010, "2015/12/17 15:00:00", 1, 2, 0.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 26002, 1, 26, 105801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "キャル", 26003, 1, 26, 106001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "コッコロ", 26004, 1, 26, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "シェフィ", 27001, 1, 27, 106401, 0.0, 2104010, "2015/12/17 15:00:00", 1, 2, 0.0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 27002, 1, 27, 105801, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "キャル", 27003, 1, 27, 106001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "コッコロ", 27004, 1, 27, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "カリン", 28001, 1, 28, 190801, 0.0, 0, "2019/09/24 15:00:00", 1, 1, 0.0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！");
