INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "コッコロ", 43002, 1, 43, 105901, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -363.0, "2030/12/17 14:59:59", "キャル", 43003, 1, 43, 106001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -416.5, "2030/12/17 14:59:59", "アメス", 43004, 1, 44, 123001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -416.5, "2030/12/17 14:59:59", "アメス", 43005, 1, 44, 123001, 0.0, 0, "2015/12/17 15:00:00", 2, 1, 0.0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -416.5, "2030/12/17 14:59:59", "アメス", 43006, 2, 45, 123001, 5.79, 0, "2015/12/17 15:00:00", 3, 1, 0.0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -371.5, "2030/12/17 14:59:59", "アメス", 46001, 1, 46, 123001, 0.0, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -416.5, "2030/12/17 14:59:59", "シズル", 47001, 2, 47, 104901, 0.0, 0, "2015/12/17 15:00:00", 1, 2, 0.0, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0, -416.5, "2030/12/17 14:59:59", "リノ", 47002, 2, 47, 101101, 9.32, 0, "2015/12/17 15:00:00", 1, 1, 0.0, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪");
